import React from "react";
import "./header.css";

function Header({ setLoginForm }) {
  return (
    <>
      <header className="header">
        <div className="header-title">
          <h1>GLP-Community</h1>
        </div>
        <div className="header-links">
          <button
            onClick={() => {
              setLoginForm(true);
            }}
          >
            Login
          </button>
          <span>|</span>
          <button
            onClick={() => {
              setLoginForm(false);
            }}
          >
            Create an account?
          </button>
        </div>
      </header>
    </>
  );
}

export default Header;
